        /*********LoadingPage*************/

    #loading {
      position: absolute;
      background-color: #FFF;
      top: 0px;
      left: 0px;
      width: 100%;
      height: 100%;
      z-index: 9999;
    }
    #loading_bg{
      background-color: rgba(0,0,0,0.7);
    }

    .loader {
      width: 250px;
      height: 50px;
      line-height: 50px;
      text-align: center;
      position: absolute;
      top: 50%;
      left: 50%;
      -webkit-transform: translate(-50%, -50%);
      transform: translate(-50%, -50%);
      font-family: helvetica, arial, sans-serif;
      text-transform: uppercase;
      font-weight: 900;
      color: #ce4233;
      letter-spacing: 0.2em;
    }
    .loader::before, .loader::after {
      content: "";
      display: block;
      width: 15px;
      height: 15px;
      background: #ce4233;
      position: absolute;
      -webkit-animation: load .7s infinite alternate ease-in-out;
      animation: load .7s infinite alternate ease-in-out;
    }
    .loader::before {
      top: 0;
    }
    .loader::after {
      bottom: 0;
    }

    @-webkit-keyframes load {
      0% {
        left: 0;
        height: 30px;
        width: 15px;
      }
      50% {
        height: 8px;
        width: 40px;
      }
      100% {
        left: 235px;
        height: 30px;
        width: 15px;
      }
    }

    @keyframes load {
      0% {
        left: 0;
        height: 30px;
        width: 15px;
      }
      50% {
        height: 8px;
        width: 40px;
      }
      100% {
        left: 235px;
        height: 30px;
        width: 15px;
      }
    }

 function checkFlag(){
  var cparent=document.getElementById("container");
  var ccontent=getChildElement(cparent,"box");//box
  var lastContentHeight=ccontent[ccontent.length-1].offsetTop;//
  var scrollTop=document.documentElement.scrollTop||document.body.scrollTop;//
  var pageHeight=document.documentElement.clientHeight||document.body.clientHeight;//
 // console.log(lastContentHeight+","+scrollTop+","+pageHeight);
  if(lastContentHeight<scrollTop+pageHeight){
   return true;
  }
 }
  
 function imgLocation(parent,content){
  var cparent=document.getElementById(parent);
  var ccontent=getChildElement(cparent,content);//box
  var imgWidth=ccontent[0].offsetWidth;//
  var num=Math.floor(document.documentElement.clientWidth/imgWidth);//
  cparent.style.cssText="width:"+imgWidth*num+"px;margin:0px auto";//container
  var boxHeightArr=[];//box
  for(var i=0;i<ccontent.length;i++){
   if(i<num){
    boxHeightArr[i]=ccontent[i].offsetHeight;
   }else{
    var minHeight=Math.min.apply(null,boxHeightArr);//
    var minIndex = getMinheightLocation(boxHeightArr,minHeight);//
 //   console.log(minHeight+","+minIndex);
    ccontent[i].style.position="absolute";
    ccontent[i].style.top=minHeight+"px";//
    ccontent[i].style.left=ccontent[minIndex].offsetLeft+"px";//
    boxHeightArr[minIndex]+=ccontent[i].offsetHeight;
 //   console.log(ccontent[i].offsetHeight+","+ccontent[i].height);//ccontent[i].height=undefined
     
   }
  }
 }
  
 function getMinheightLocation(boxHeightArr,minHeight){
  for(var i in boxHeightArr){
   if(boxHeightArr[i]==minHeight){
    return i
   }
  }
 }
  
 function getChildElement(parent,content){
  //parentcontent
  var contentArr=[];
  var allContent=parent.getElementsByTagName("*");
  for(i=0;i<allContent.length;i++){
   if(allContent[i].className=="box"){
    contentArr.push(allContent[i]);
   }
  }
  return contentArr;
 }
